import React from 'react';
import './JumboBanner.css';

const JumboBanner = () => {
  return (
    <div className="JumboBanner">
      <div className="LargeText">
        Arizona's Quality Shop since 1979
      </div>
      <div className="TitleText">
        Mighty Muf'ler
      </div>
      <div className="TitleText">
        602-944-5210
      </div>
    </div>
  );
}

export default JumboBanner;
